(function($) {
  "use strict"; // Start of use strict

  $('#gen_form').click(function() {

    console.log('test');

    let req_mat_name = document.getElementById('req_mat_name').value
    let req_quant = document.getElementById('req_quant').value
    let req_name = document.getElementById('req_name').value
    let req_email = document.getElementById('req_email').value
    let req_phone = document.getElementById('req_phone').value
    let req_deparment = document.getElementById('req_deparment').value
    let req_inst = document.getElementById('req_inst').value
    let req_address = document.getElementById('req_address').value
    let req_fedex = document.getElementById('req_fedex').value

    let timenow = new Date().toLocaleString();

    var imgData="data:image/jpeg;base64,";

    const pdf = new jsPDF("portrait","mm","letter");

    pdf.addImage(imgData, 'JPEG', 10, 10, 179.5, 16.25);
    pdf.setFontStyle("bold")
    pdf.setFontSize(18)
    pdf.text(10, 37, `Material Request Form`);
    pdf.setFontSize(12)
    pdf.text(80, 37, `(for resources developed by projects DK099810 and DK114785)`);
    pdf.setFontStyle("normal")
    pdf.setFontSize(12)
    pdf.text(10, 50, `Date and time: ${timenow}\r\n`);
    pdf.text(10, 65, `Requested material(s): ${req_mat_name}`);
    pdf.text(10, 80, `Requested quantity: ${req_quant}`);
    pdf.text(10, 95, `Name: ${req_name}`);
    pdf.text(10, 110, `E-mail: ${req_email}`);
    pdf.text(10, 125, `Phone number: ${req_phone}`);
    pdf.text(10, 140, `Department: ${req_deparment}`);
    pdf.text(10, 155, `University / Institute: ${req_inst}`);
    pdf.text(10, 170, `Shipping Address:`);
    pdf.text(12, 180, `${req_address}`);
    pdf.text(10, 210, `FedEx account: ${req_fedex}`);
    pdf.text(10, 225, `Please e-mail this form to rc2requests@scripps.edu`);
    pdf.save(`TSRI reagent request form - ${req_name}.pdf`);
  });

  $.urlParam = function(name){
  	var results = new RegExp('[\?&]' + name + '=([^&#]*)').exec(window.location.href);
  	return results[1] || 0;
  }

  $(document).ready(function() {
    console.log($.urlParam('item'))
    $('#req_mat_name').val($.urlParam('item'));
  });

})(jQuery); // End of use strict
